import React, { Component } from 'react';
import hangry_cat from './hangry_cat.jpg';
import './App.css';
import './index.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
       <main>     
        <img alt="angry cat" src={hangry_cat}></img>
        <h1>Find somewhere to eat, MEOW!</h1>   

        <div id="food-type">
          <div className="dropdown">
            <button className="button">What are you craving?</button>
            <div className="dropdown-content">
              <a href="#">Pizza</a>
              <a href="#">Burgers</a>
              <a href="#">Chinese</a>
            </div>
          </div>
        </div>

        <div id="surprise">
          <button className="button">I can't decide; pick for me!</button>
        </div>                
      </main>

        </header>
      </div>
    );
  }
}

class MyComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <ul>
          {items.map(item => (
            <li key={item.name}>
              {item.name} {item.price}
            </li>
          ))}
        </ul>
      );
    }
  }
}

export default App;
